    override suspend fun load(name: String): WordList = withContext(Dispatchers.Default) {
        val text = wordLists[name.lowercase()]
        (if (text == null) {
            null
        } else {
            val separator = if (name.lowercase() == "japanese") '\u3000' else ' '
            val words = text.split(" ").filter { it.isNotBlank() }
            WordList(words, separator, name)
        }) as WordList
    }
}